result:
.search-page{
    padding:10px 15px 0;
    .search-box{
        background: #f1f3f5;
        padding: 5px;
        display: flex;
        .search-input{
            height: 30px;
            line-height: 30px;
            display: block;
            padding-left: 50px;
            flex: 1;
            background:#fff url(http://www.ruyutrip.com/img/mb_v2/list_icon.png)no-repeat 10px center;
            background-size: 15px 15px;
            &:focus{
                outline: none
            }
        }
        .search-cancle{
            height: 30px;
            line-height: 30px;
            width:80px;
            text-align: center;
            color:#333;
        }
    }
    .hot-list{
        overflow: hidden;
        padding-top: 30px;
        div{
            font-size: 16px;
            padding-bottom: 20px;
            .del{
                width:16px;
                height:16px;
                float: right;
                margin-top:5px;
            }
        }
        .hot-item{
            display:inline-block;
            line-height: 22px;
            padding:3px 10px;
            background: #eee;
            margin-right: 15px;
            color:#999;
            border-radius: 4px;
            margin-bottom: 5px;
        }
    }
    .result-list{
        .result-item{
            height: 46px;
            line-height: 46px;
            border-bottom: 1px solid #eee;
            overflow: hidden;
             text-overflow:ellipsis;
             white-space: nowrap;
        }
        .noResult{ 
            text-align: center;
            padding: 30px 15px;
        }
    }
}
